create table events
(
    id                bigserial
        primary key,
    name              varchar(200)              not null,
    date              date,
    location          varchar(200),
    link_ufc_stats    varchar(255)              not null,
    link_tapology     varchar(255),
    processed         boolean     default false not null,
    processing_status varchar(20) default 'pending'::character varying,
    created_at        timestamp   default now(),
    updated_at        timestamp
);

alter table events
    owner to fightstats;

create unique index uk_events_name_date_location
    on events (name, date, location);

create index idx_events_processing_status
    on events (processing_status);

create index idx_events_date
    on events (date);

